            <div className = "Login">
                <div className = "User-block">
                    <SideBar />
                </div>
                <div className = "Google-Login">
                <GoogleOAuthProvider  clientId="325684444932-r6ba80mc6eong2p7dnn62flrqd3266c6.apps.googleusercontent.com">
                    <React.StrictMode>
                        <div>
                            <h2 className = "Title"> Login </h2>
                            <br />
                            <br />
                            <GoogleLogin onSuccess={responseMessage} onError={errorMessage}/>
                        </div>
                    </React.StrictMode>
                </GoogleOAuthProvider>
                </div>
            </div>
        );
}
export default Login;
